import React from "react";
import avatar from "../../assets/images/avatar.jpg";

const EditProfile = () => {
  return (
    <div className="edit-profile">
      <div className="edit-profile-avatar">
        <img src={avatar} alt="avatar" />
      </div>
    </div>
  );
};

export default EditProfile;
